value.css:
.canvasRenderEl {
  background: #efefef;
  overflow: hidden;
  height: 200px !important;
  width: 300px !important;
  margin: 0 auto;
}

.canvasRenderEl .canvasMarkdown {
  width: 1200px;
  -webkit-animation: slide 18s ease infinite;
}

.canvasRenderEl p {
  float: left;
  height: 200px;
  width: 300px;
  text-align: center;
  font-size: 1.5em;
  line-height: 200px;
padding: 0;
}

.canvasRenderEl p:nth-child(1) {
  background: #D93B65;
}

.canvasRenderEl p:nth-child(2) {
  background: #037E8C;
}

.canvasRenderEl p:nth-child(3) {
  background: #36BF66;
}

.slide-number {
  color: #000;
  text-align: center;
  font-size: 10em;
}

@-webkit-keyframes slide {
  20% {margin-left: 0px;}
  30% {margin-left: -300px;}
  50% {margin-left: -300px;}
  60% {margin-left: -600px;}
  70% {margin-left: -600px;}
  80% {margin-left: -900px;}
  90% {margin-left: -900px;}
}
